import React from 'react';
import { Conteudo, Titulo, Paragrafo, Botao,AreaBotao } from "../sobre/estilos"
import { HashLink as Link } from "react-router-hash-link";


export default function Sobre() {
  return (
    <Conteudo  id="sobre" >

      <Titulo >   SOBRE NOSSO AMIGUINHO GASPARZINHO </Titulo>

      <Paragrafo>

      Gasparzinho é o amigo virtual, ele esta muito triste, porque se sente 
      sozinho. Gosta bastante de conversar sobre diversos assuntos, adora 
      ajudar as pessoas, está sempre atualizado sobre as redes socias e 
      noticias no geral. Sempre está disposto a encontrar um novo amigo. 
      Venha conhecer nosso amiguinho virtual.

      </Paragrafo>

      <AreaBotao>

       <Link  smooth  to="#header">Voltar para inicio</Link>  
       <Botao>Conhecer?</Botao>

      </AreaBotao> 
    </Conteudo>
  );
}
